import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import bg from "../home-bg.png"
import nurse from "../nurse.png";

function Home() {
    return (
        <div className="landing">
            <li>
                <ul>Our Team</ul>
                <ul>Portal</ul>
            </li>
            <img src={nurse} className="nurse"></img>
            <h1>"Drivcon Home"</h1>
            <Link to="/"><Button>Go to Portal</Button></Link>
        </div>
    );
}

export default Home;
